import React, { useState } from 'react';
import './AdministratorHomepage.css';
import backgroundAdmin from '../../images/bgAdmin.png';
import imageLogo from '../../images/asd.png';

const AdministratorHomepage = () => {
    const [isButtonClicked, setIsButtonClicked] = useState(false);

    const handleButtonClick = () => {
        setIsButtonClicked(!isButtonClicked);
    };

    return (
        <div className='welcomeAdminPage'>
            <div className='sideMenu'>
                <ul className='menuOnSidebar'>
                    <li className='itemListAdmin'>
                        <button className={`btItem1 ${isButtonClicked ? 'clicked' : ''}`} onClick={handleButtonClick}>
                            จัดการบัญชีผู้ใช้งาน
                        </button>
                    </li>
                    <li className='itemListAdmin'>
                        <button className={`btItem2 ${isButtonClicked ? 'clicked' : ''}`} onClick={handleButtonClick}>
                            ยืนยันการมีหน้าร้าน
                        </button>
                    </li>
                    <li className='itemListAdmin'>
                        <button className={`btItem3 ${isButtonClicked ? 'clicked' : ''}`} onClick={handleButtonClick}>
                            การรายงาน
                        </button>
                    </li>
                </ul>
                <div className='frameImageOnSidebar'>
                    <img className='imageOnSidebar' src={imageLogo} alt="Logo" />
                </div>
            </div>
            <div className='picAdminPage' style={{ backgroundImage: `url(${backgroundAdmin})` }}>
                <h1 className='welcomeAdmin'>ยินดีต้อนเข้ารับสู่ระบบของผู้ดูแลระบบคาบิซู</h1>
            </div>
        </div>
    );
}

export default AdministratorHomepage;
